import React from "react";

import Drawer from "@material-ui/core/Drawer";
import { makeStyles } from "@material-ui/core/styles";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import Divider from "@material-ui/core/Divider";
import AccessibilityIcon from "@material-ui/icons/Accessibility";
import LibraryBooksIcon from "@material-ui/icons/LibraryBooks";
import DashboardIcon from "@material-ui/icons/Dashboard";
import MusicNoteIcon from "@material-ui/icons/MusicNote";
const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
}));

const menu = ["/", "/about", "/modules"];

const SidebarDrawer = (props) => {
  const classes = useStyles();
  const [selectedIndex, setSelectedIndex] = React.useState(menu[0]);

  const handleListItemClick = (event, index) => {
    setSelectedIndex(index);
    navigate(menu[index]);
  };
  return (
    <div>
      <Drawer open={props.drawer} onClose={props.hideDrawer}>
        <div style={{ width: 250 }} className={classes.root}>
          <List component="nav" aria-label="main mailbox folders">
            <ListItem
              button
              selected={selectedIndex === 0}
              onClick={(event) => handleListItemClick(event, 0)}
            >
              <ListItemIcon>
                <DashboardIcon />
              </ListItemIcon>
              <ListItemText primary="Dashboard" />
            </ListItem>
            <ListItem
              button
              selected={selectedIndex === 1}
              onClick={(event) => handleListItemClick(event, 1)}
            >
              <ListItemIcon>
                <MusicNoteIcon />
              </ListItemIcon>
              <ListItemText primary="Simulator" />
            </ListItem>
          </List>
          <Divider />
          <List component="nav" aria-label="secondary mailbox folder">
            <ListItem
              button
              selected={selectedIndex === 2}
              onClick={(event) => handleListItemClick(event, 2)}
            >
              <ListItemIcon>
                <LibraryBooksIcon />
              </ListItemIcon>
              <ListItemText primary="Modules" />
            </ListItem>
            <ListItem
              button
              selected={selectedIndex === 3}
              onClick={(event) => handleListItemClick(event, 3)}
            >
              <ListItemIcon>
                <AccessibilityIcon />
              </ListItemIcon>
              <ListItemText primary="Students" />
            </ListItem>
          </List>
        </div>
      </Drawer>
    </div>
  );
};

export default SidebarDrawer;
